Not sure where to start. 🥰 but I’ll start by thanking everyone who played a part in putting together this amazing night, celebrating the upcoming arrival of our baby girl. Without your help, I couldn’t have managed to pull this off, especially in the midst of our wedding season. It takes a village to create something magical, the support from you all has been overwhelming and I will forever be grateful. 
Mom and Brenda, – thank you for being my sounding board and helping with all the planning and prepping while I was traveling for work. Dad, Erik, Yoanna, kimmy, and Desi. Thank you for helping out. Your support has been invaluable and for that I am very grateful. 
@villasanctimalibu thank you for generously sharing your beautiful property- I could not have imagined a more perfect space to host.
 @mulberryandmoss you truly are a gem-. Thank you for always going along with my crazy and questionable design choices when given the opportunity to create without boundaries. You always get the assignment and produce with finesse and refinement. This design is more than I could have ever imagined. You are truly talented and don’t you ever forget that!
@anyakernes my dear friend, thank you for capturing this special day for us and not complaining about my long shot list 🤣! I realized it when I started my email with- “I apologize in advance for the long shot list”...- I cherish your friendship. 
@stevendornfilms , thank you for being part of this night. It’s always a joy working with you, you are truly talented. I’m so glad our paths crossed- thank you Shauntelle for the intro - you are amazing!!! ;) and thank you @spostophoto for the behind the scenes and helping out! You are amazing, and can’t wait for you to join us in Utah! 
Danielle @itspapercliche , thank you for the beautiful stationery. It added a perfect compliment to the design. 

To the rest of the vendors – @catalogatelier , @adorefolklore , @premiere_rents @rajtentsllc @nuagedesignsinc @minted @vogue.candles @thelonepinedesigner  @aaroncopenhaguen , and @secondsong_official Song– thank you for bringing everything to life.

✨ Workshop Day 1 ✨
After greeting our attendees after their long travels, we dove into inspiring lectures about branding, goal setting, and identifying and capturing dream clients. Our students dispersed into small group breakout sessions to share their goals with their fellow students. After a full day of learning we gathered for our welcome dinner (more photos to come soon!) It was an amazing first day! We hope our students are getting lots of rest for tomorrow, as we will be diving into centerpiece design!

